          </IonItem>
          <IonItem>
            <IonLabel>Mega Man X</IonLabel>
          </IonItem>
          <ItemList name="Hola" />
          <ItemList name="Hola" />
          <ItemList name="Hola" />
        </IonList>
      </IonContent>
    </IonPage>
  );
};

export default Customers;
